import { all ,call,put,takeLatest, fork } from 'redux-saga/effects';
import { LOG_IN } from '../Reducer/user';

function loginAPI(){

}

function* login(){
    try{
        yield call(loginAPI);
        yield put({
            type:LOG_IN_SUCCESS
        })
    }catch(e){
        console.log(e)
        yield put({
            type:LOG_IN_FAIL
        })
    }
}

function* wwatchLogin(){
    yield takeLatest(LOG_IN,login)
}

export default function* userSaga(){
    yield all([
        fork(wwatchLogin)
    ]);
}
